Let's start with an example, in which some users want to deploy a multi-signature account to some shared asset. They create a transaction, which would initialize a new account with an address shared-savings and write into its storage sub-space the initial funds for the account and data under the key "multisig" with the following definition: #[derive(Schema)]
struct MultiSig { threshold: u64, counter: u64, keys: Vec<PublicKey>,
} When the transaction is applied, the data is stored together with a reference to the derived data schema, e.g.: { "MultiSig": { "struct": { "named_fields": { "threshold": "u64", "counter": "u64", "keys": { "sequence": "PublicKey" } } } }
} Now any transaction that wants to interact with this account can look-up and use its data schema. We can also use this information to display values read from storage from e.g. RPC or indexer. What's more, when the data has schema attached on-chain, with borsh we have bijective mapping between the data definitions and their schemas. We can use this nice property to generate code for data definitions back from the schema in any language supported by borsh and that we'll able to support in wasm. We can take this a step further and even generate some code for data access on top of our wasm environment functions to lift the burden of encoding/decoding data from storage. For our example, from the key "multisig", in Rust we can generate this code: fn read_multisig() -> MultiSig;
fn write_multisig(MultiSig);
fn with_multisig(FnMut(MultiSig) -> MultiSig); Which can be imported like regular library code in a transaction and arbitrarily extended by the users. Similarly, the schema could be used to derive some code for validity predicates and intents. We can generate the code on demand (e.g. we could allow to query a node to generate library code for some given accounts for a given language), but we could also provide some helpers for e.g. foundation's or validator's node to optionally automatically publish generated code via git for all the accounts in the current state. In Rust, using this library could look like this: // load the account(s) code where the identifier is the account's address.
use anoma_accounts::SharedSavings; fn transaction(...) { let multisig = SharedSavings::read_multisig(); ...
}
